import Hobby from "../Layouts/Hobby";
import DATA from "../../datas/HobbyList"

function HobbyList() {
    return (
        <div className="flex flex-col grow gap-6 p-4 md:p-6">
            {DATA.map((hobby, index) => {
                <Hobby name={hobby.name} icon={hobby.icon} key={index} />
            })}
        </div>
    );
}

export default HobbyList;
